import styled from "styled-components"

const Wrapper = styled.div`
    display: flex;
    align-items: center;
`
const Button = styled.button`
    width: 420px;
    font-weight: 600;
    background-color:#F7E600;
    color: #3A1D1D;
    padding: 10px;
    margin: 40px 10px 10px 10px;
    border: none;
    font-size: 17px;
    border-radius: 5px;
    &:hover{
        opacity: 0.92;
    }
`
const Img = styled.img`
    background-image: url("public/image/kakao.png");
`


export default function KakaoLoginButtin(){
    return(
        <Wrapper>
            <Button>
                <Img></Img>
            </Button>
        </Wrapper>
    )
}
